                    <br>
                    <font size="4" color="#4CAF50"><b>Bạn sẽ làm gì...</b></font> <br>
                     Hãy CHO ĐIỂM mỗi mẫu bạn nhìn thấy, chẳng hạn <i>0</i> tượng trưng cho <b>KHÔNG THÍCH</b> và <i>20</i> cho thấy bạn <b>THÍCH</b> mẫu trên. Xin <mark> vui lòng cho điểm càng sớm càng tốt, trước khi thời gian của mẫu kết thúc.</mark> (thể hiện ở thanh màu xanh ở phía trên màn hình). *Cửa sổ này sẽ chuyển sang chế độ toàn màn hình khi thí nghiệm bắt đầu. <br>Bạn luôn có thể theo dõi tiến độ hoàn tất thí nghiệm ở hình tròn màu xám xuất hiện ở góc phải phía trên màn hình. Nếu bạn muốn tạm dừng thí nghiệm, hãy bấm vào hình tròn này.
                    <br><br> <font size="4" color="#4CAF50"><b>Những lưu ý</b></font><br>
